import React from "react";
import './FAQList.css'


function FAQList() {
    return (
        <div style={{ margin: '0 20px' }}>
            <div>
                <h3>Частые вопросы</h3>
            </div>
            <ul className="FAQ-list" >
                <li><a className="FAQ-list-item" href='/FA'>Открыт ли монастырь для посещений?</a></li>
                <li><a className="FAQ-list-item" href='/'>Как добраться до монастыря?</a></li>
                <li><a className="FAQ-list-item" href='/'>Работает ли трапезная?</a></li>
                <li><a className="FAQ-list-item" href='/'>Есть ли безналичный расчет?</a></li>
                <li><a className="FAQ-list-item" href='/'>Проводится ли у нас таинство крещения?</a></li>
                <li><a className="FAQ-list-item" href='/'>Как заказать поминовение?</a></li>
                <li><a className="FAQ-list-item" href='/'>Можно ли переночевать в монастыре?</a></li>
            </ul>
        </div>
    );
}

export default FAQList;
